Field traversal is the mechanism used to navigate through a data structure, pinpointing specific fields or relationships. The design of the surreal_orm makes traversal not only intuitive but also direct, offering methods to navigate fields, relationships, and even to apply specific conditions. To get started, let's set up our environment: use pretty_assertions::assert_eq;
use surreal_models::{student, Student};
use surreal_orm::{index, this, where_, All, Buildable, Operatable, SchemaGetter, ToRaw, E};

101.body:
Every traversal starts with the root object. The this() function is your gateway, representing the current node or object you're working on. # fn basic() {
let param_with_path = this();
assert_eq!(param_with_path.to_raw().build(), "$this");
# } In the code snippet above, the this() function signifies a reference to the root object or the primary context of the traversal. When executed, this will produce "$this".

103.body:
Sometimes, all you want is to directly access a field within an object. Here's how you can achieve that: # fn test_param_simple_clause() {
let param_with_path = this().with_path::<Student>(E).lastName;
assert_eq!(param_with_path.to_raw().build(), "$this.lastName");
# } In this example, the alias E (standing for Empty) is employed to directly traverse to the lastName field of the Student object.

104.body:
At other times, you might want to directly access a field within an array: # fn test_param_with_path_simple() {
let param_with_path = this().with_path::<Student>([2]).firstName;
assert_eq!(param_with_path.to_raw().build(), "$this[2].firstName");
# } Here, the code fetches the firstName of the Student located at index 2.

105.body:
The true essence of a graph database is revealed when traversing deep relationships. Consider this test: # fn test_param_with_path() {
let param_with_path = this() .with_path::<Student>([2]) .bestFriend() .bestFriend() .course() .title;
assert_eq!(param_with_path.to_raw().build(), "$this[2].bestFriend.bestFriend.course.title");
# } This test showcases how to navigate through a Student's best friend's best friend's course title.

106.body:
An alternate to square bracket notation [2] is the index helper function e.g(index(2)): # fn test_param_with_path_with_index_square_bracket_variation() {
let param_with_path = this() .with_path::<Student>(index(2)) .bestFriend() .bestFriend() .course() .title;
assert_eq!(param_with_path.to_raw().build(), "$this[2].bestFriend.bestFriend.course.title");
# }

107.body:
You can also traverse paths with conditions, allowing for more refined querying: # fn test_param_with_path_with_clause() {
let student::Schema { age, .. } = Student::schema();
let param_with_path = this() .with_path::<Student>(where_(age.greater_than(18))) .bestFriend() .allSemesterCourses([5]) .title;
assert_eq!(param_with_path.to_raw().build(), "$this[WHERE age > 18].bestFriend.allSemesterCourses[5].title");
# } This traversal fetches the title of the fifth semester course of the best friends of students older than 18.

108.body:
For scenarios where you want to traverse all items or elements of a certain relationship or field, the All wildcard is invaluable: # fn test_param_with_path_with_all_wildcard() {
let param_with_path = this() .with_path::<Student>(All) .bestFriend() .allSemesterCourses([5]) .title;
assert_eq!(param_with_path.to_raw().build(), "$this[*].bestFriend.allSemesterCourses[5].title");
# } In the traversal above, All is a wildcard that represents every instance of the Student type. The traversal then specifies the fifth course title of all students' best friends.

109.body:
There are scenarios where traversing multiple indexed fields or relationships becomes necessary: # fn test_param_with_path_multiple_indexes() {
let param_with_path = this() .with_path::<Student>([2]) .bestFriend() .allSemesterCourses([5]) .title;
assert_eq!(param_with_path.to_raw().build(), "$this[2].bestFriend.allSemesterCourses[5].title");
# } Here, the traversal first targets the Student at index 2 and then fetches the title of the fifth semester course of that student's best friend.

