To define variables and bind them within a code block, you can use the let statement (or LET statement) within the block! macro. This approach offers simplicity and automation in handling variable bindings and parameter references. Let's take a look at an example: let alien = Table::new("alien");
let metrics = Table::new("metrics");
let strength = Field::new("strength"); let code_block = block! { let strengths = select_value(strength).from(alien); let total = math::sum!(strengths); let count = count!(strengths); let name = "Oyelowo";
}; // This is equivalent to the above. Note: This is not to be confused with actual Rust's native `let` keyword. let code_block = block! { LET strengths = select_value(strength).from(alien); LET total = math::sum!(strengths); LET count = count!(strengths); LET name = "Oyelowo";
}; In the code snippet above, the let (or LET) statements bind the variables strengths, total, count, and name within the code block. These variables are automatically handled by the ORM, simplifying the query construction process. The generated SQL query for this code block would look like: LET $strengths = (SELECT VALUE strength FROM alien); LET $total = math::sum($strengths); LET $count = count($strengths); LET $name = 'Oyelowo'; The recommended approach using the let statement (or LET statement) within the block! macro is preferred because it provides a clean and concise syntax, handles variable bindings and parameter referencing automatically, and promotes code readability.

