To perform a transaction and cancel it, discarding any changes made within the transaction, you can use the block! macro to chain multiple statements together. The cancel_transaction statement is used within the block! macro to explicitly indicate the cancellation of the transaction. Let's take a look at an example: let db = Surreal::new::<Mem>(()).await.unwrap();
db.use_ns("test").use_db("test").await.unwrap(); let ref id1 = Account::create_id("one".into());
let ref id2 = Account::create_id("two".into());
let acc = Account::schema(); let amount_to_transfer = 300.00; block! { BEGIN TRANSACTION; LET acc1 = create().content(Account { id: id1.clone(), balance: 135_605.16, }); LET acc2 = create().content(Account { id: id2.clone(), balance: 91_031.31, }); LET updated1 = update::<Account>(id1).set(acc.balance.increment_by(amount_to_transfer)); LET update2 = update::<Account>(id2).set(acc.balance.decrement_by(amount_to_transfer)); CANCEL TRANSACTION;
}; Ok(()) In the code snippet above, the block! macro is used to define a transaction with multiple statements. The LET statement is used to bind variables acc1, acc2, updated1, and update2 to the respective statements. The BEGIN TRANSACTION statement marks the start of the transaction, and the CANCEL TRANSACTION statement explicitly cancels the transaction. The generated SQL query for this code block would look like: BEGIN TRANSACTION; LET acc1 = CREATE account CONTENT { balance: 135605.16, id: account:one };
LET acc2 = CREATE account CONTENT { balance: 91031.31, id: account:two };
LET updated1 = UPDATE account:one SET balance += 300.0;
LET update2 = UPDATE account:two SET balance -= 300.0; CANCEL TRANSACTION; Using the block! macro with the cancel_transaction statement within the block provides a clear and concise way to define a transaction and cancel it.

