You can explicitly set the table name using the table attribute. By default, the table name should be the snake case of the struct name. This is to ensure consistency and uniqueness of table model struct. If you want a name other than the snake case version, you need to add the attribute - relax_table: #[derive(Node, Serialize, Deserialize)]
#[orm(table = "student_test")]
pub struct StudentTest { id: SurrealSimpleId<Self>,
} The corresponding table definition would be: DEFINE TABLE student_test;

