pub type AlienVisitsPlanet = Visits<Alien, Planet>; This attribute specifies that an Alien has a read-only relationship with Planet through the AlienVisitsPlanet model. The connection attribute describes the relationship path between the Nodes. The relationship is read-only because the serde(skip_serializing) attribute is used to prevent it from being serialized. These attributes provide additional information to Surreal for modeling relationships and embedding Objects within Nodes, allowing for more complex and flexible database schema designs.
